import React from "react";

const MinimalTest = () => {
  console.log("MinimalTest component is rendering");

  return (
    <div
      style={{
        position: "fixed",
        top: "50%",
        left: "50%",
        transform: "translate(-50%, -50%)",
        backgroundColor: "red",
        color: "white",
        padding: "50px",
        fontSize: "24px",
        zIndex: 9999,
        border: "5px solid yellow",
      }}
    >
      <h1>TESTE MÍNIMO</h1>
      <p>Se você vê isso, o componente está renderizando!</p>
      <p>Timestamp: {new Date().toLocaleTimeString()}</p>
    </div>
  );
};

export default MinimalTest;
